from itertools import count, islice
def agen(): # generator of terms
    n = 1
    for k in count(1):
        s = str(k)
        prefixes = [int(s[:i+1]) for i in range(len(s))]
        if all(any(ki%m == 0 for ki in prefixes) for m in range(1, n+1)):
            yield k; n += 1
            while any(ki%n == 0 for ki in prefixes):
                yield k; n += 1
